class BolaConfig{showEditModal(n){const t=$("#editModal");$.ajax({method:"GET",url:"/bolaconfig/edit?currency="+n}).done(function(n){n&&(t.find("#editdetails").html(n),t.modal("show"))})}submitEdit(){const n=$("#editModal");n.find("#updateBtn").prop("disabled",!0);$.ajax({method:"POST",url:"/bolaconfig/edit",dataType:"json",data:n.find("#editForm").serialize()}).done(function(t){t?n.find("#successMsg").show():n.find("#failedMsg").show();setTimeout(function(){n.find("#updateBtn").prop("disabled",!1);n.modal("hide");bolaConfig.loadReport()},1e3)})}showEditAmount(n,t){const i=$("#editAmountModal");$.ajax({method:"GET",url:"/bolaconfig/editamount?currency="+n+"&amount="+t}).done(function(n){n&&(i.find("#editdetails").html(n),i.modal("show"))})}submitEditAmount(){const n=$("#editAmountModal");n.find("#updateBtn").prop("disabled",!0);$.ajax({method:"POST",url:"/bolaconfig/editamount",dataType:"json",data:n.find("#editForm").serialize()}).done(function(t){t?(n.find("#successMsg").show(),setTimeout(function(){n.find("#updateBtn").prop("disabled",!1);n.modal("hide")},1e3)):(n.find("#failedMsg").show(),n.find("#updateBtn").prop("disabled",!1),setTimeout(function(){n.find("#failedMsg").hide()},2e3))})}showLoad(){const n=$("#reloadModal");n.find("#reloadContent").html("Are you sure you want to Load new Config?");n.modal("show")}submitLoad(){const n=$("#reloadModal");n.find("#confirmBtn").prop("disabled",!0);$.ajax({method:"POST",url:"/bolaconfig/loadnew"}).done(function(t){t?n.find("#updateMsgSuccess").show():n.find("#updateMsgFailed").show();setTimeout(function(){n.find("#confirmBtn").prop("disabled",!1);n.find("#updateMsgSuccess").hide();n.find("#updateMsgFailed").hide();n.modal("hide");bolaConfig.loadReport()},1e3)})}loadReport(){const n=$("#bolaConfigForm");n.submit()}}var bolaConfig=new BolaConfig;stickHeader.stick(".inner-content","table#report-table",120,-20);$(document).ready(function(){bolaConfig.loadReport()});